import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <div className="container padding-responsive">
      <h1 className="text-responsive">Welcome to the Marketing Campaign</h1>
      <p className="margin-responsive">Create and manage your marketing campaigns with our form builder.</p>
      <div className="margin-responsive">
        <Link to="/builder" className="btn btn-primary">
          Start Building a Form
        </Link>
      </div>
    </div>
  );
};

export default HomePage;
